import React from 'react';
import './Card.css'
import { Link } from "react-router-dom";


function Card({ src, house_type, description, price }) {
    return (
        <div className='card'>
            <img src={src} alt="" width={200} />
            <div className="card__info">
                <h2>{house_type}</h2>
                <h4>{description}</h4>
                <h3>{price}</h3>
            </div>

            <a href="/booking"><button type='submit' className='book'>Book house</button>
            </a>            

        </div>
    )
}

export default Card
